const Cards = (props)=>{
  return(
      <div className="bg-gray-200  shadow shadow-blue-500/100	m-5 w-52 h-96 flex flex-col hover:scale-105 duration-300">
      <img className="h-48 mb-5" src={props.img} alt="img" />
      <p className="font-bold	ml-1.5 text-slate-500	">{props.title}</p>
      <p className="font-bold	ml-1.5	text-slate-400 ">{props.category}</p>
      <p className="font-bold	ml-1.5	">Rs : {props.price}</p>
      </div>
  )
}
export default Cards ;
